%%%%%%%%%%%%Adjust Demands%%%%%%%%%%%%%%%
for i=1:1:NumOfFAP
    D_tmp = UEInfo(3,(i-1)*NumOfUEPerFAP+1:i*NumOfUEPerFAP);
    D_tmp = sort(D_tmp);
    Distance_tmp = zeros(1,NumOfUEPerFAP);
    for j=1:1:NumOfUEPerFAP
        TargetUE = (i-1)*NumOfUEPerFAP+j;
        Distance_tmp(j) = sqrt((FAPInfo(1,i)-UEInfo(1,TargetUE))^2+(FAPInfo(2,i)-UEInfo(2,TargetUE))^2);
    end
    [Dis_result , Dis_pos] = sort(Distance_tmp);
    for j=NumOfUEPerFAP:-1:1
        TargetUE = (i-1)*NumOfUEPerFAP+Dis_pos(j);
        UEInfo(3,TargetUE) = D_tmp(NumOfUEPerFAP-j+1);
    end
end
        
        
%%%%%%%%%%%%Interference Estimation%%%%%%%%%%%%%%%
I_matrix_pre = zeros(NumOfFAP,NumOfUE);
for i=1:1:NumOfUE
    for j=1:1:NumOfFAP
        if floor((i-1)/NumOfUEPerFAP)+1 ~= j
            if sqrt((FAPInfo(1,j)-UEInfo(1,i))^2+(FAPInfo(2,j)-UEInfo(2,i))^2) <= IRadius
                I_matrix_pre(j,i) = 1;
            end
        end
    end
end

I_matrix = zeros(NumOfFAP,NumOfUE);%aim to draw the picture of conflict graph
for i=1:1:NumOfUE
    [TempSINR,InterferenceFAP] = ReceivedSINR(i,FAPInfo,UEInfo,SINR_Threshold,BPerCarrier,I_matrix_pre);%initialize SINR of each UE
    UEInfo(4,i) = TempSINR;% no use 
    I_matrix(:,i) = InterferenceFAP';
end
for i=1:1:NumOfFAP%complement I_matrix with TargetFAP Info
    for j=(i-1)*NumOfUEPerFAP+1:1:i*NumOfUEPerFAP
        I_matrix(i,j) = 1;
    end
end
%%%%%%%%%%%%%%%%%%%%%%%%Initialize conflict graph generated by I_matrix%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
Conflict_Graph = zeros(NumOfUE,NumOfUE);
for i=1:1:NumOfUE
    for j=1:1:NumOfFAP
        if(I_matrix(j,i) == 1)
            for k=((j-1)*NumOfUEPerFAP+1):1:j*NumOfUEPerFAP
                Conflict_Graph(i,k) = 1;%do not consider the symmetrical matrix,the Confict_Graph is not completed
                Conflict_Graph(k,i) = 1;%complement the Conflict_Graph
            end
        end
    end
end
for i=1:1:NumOfUE%generate a adjacent matrix(set element on the diagonal to 0)
    Conflict_Graph(i,i) = 0;
end

